import { Link } from "react-router-dom";
import React from 'react';

const NavBar = () => {

    return (
        <nav>
            <Link to="/"  ><h1> Prueba Page</h1></Link>
            <ul>
                <li><Link to ="/">Inicio</Link></li>
            </ul>
        </nav>
    )

}

export default NavBar;
